import React from 'react';
import { makeStyles } from "@mui/styles";
import card_back from "./card_back.png";
import pack_design from '../../assets/pack_design.png';

// import TestCard from '../CardItem/TestCard/TestCard';
import MainCard from '../CardItem/MainCard/MainCard';
import HoloCard from '../CardItem/HoloCard/HoloCard';

const useStyles = makeStyles((theme) => ({
    main: {
        width: "100%", display: "flex", justifyContent: "space-around",
        padding: 20,
    },
    show: {
        display: "auto",
        position: "absolute",
        marginLeft: "45%",
        width: 600,
        height: 600,
        transition: "transform 1s ease"
    },
    packOuter: {
        // display: "flex",
        // justifyContent: "center",
    },
    pack: {
        transition: "transform ease 1s",
        width: "420px", height: "590px",
        "&:hover": {
            transform: "scale(1.05)",
            boxShadow: "white 5px 5px"
        }
    }
}))

const PacksFrame = () => {
    const classes = useStyles();

    return (
        <div className={classes.main}>
            <img src={pack_design} alt="logo" className={classes.pack} />
        </div>
    )
}

export default PacksFrame;
